import React from 'react'
import Aux from "../../Hoc/Auxiliary"
const Layout =(props)=>(
    <Aux>
    <div>Toolbar,SideDrawer, ackDrop</div>
    <main>
        {props.children}
    </main>
    </Aux>
);

export default Layout
